import React from "react";
import s from "./Header.module.css";
import logo from "../../assets/images/Logo.png";

const Header = () => {
  return (
    <div>
      <div className={s.logoText}>
        <div>
          <img src={logo} />
        </div>
        <a href="#">Shadow Store</a>
      </div>
    </div>
  );
};

export default Header;
